export class Cas{
  predmet : string = "";
  nastavnik : string = "";
  ucenik : string = "";
  opis : string = "";
  datumvreme : Date = new Date();
  datumvremekraj : Date = new Date();
  odrzan : number = 0;
  komentar : string = "";
  potvrdjen : number = 0;
  ocena : number = 0;
}
